-- DROP'ping tables clear out any existing data
DROP TABLE IF EXISTS listings;

CREATE TABLE listings(
    listing_id SERIAL PRIMARY KEY,
    user_id VARCHAR(20) NOT NULL REFERENCES users (user_id),
    status CHAR(1) NOT NULL,
    price NUMERIC NOT NULL,
    headline VARCHAR(100) NOT NULL,
    description VARCHAR(1000) NOT NULL,
    postal_code CHAR(6) NOT NULL,
    images SMALLINT NOT NULL DEFAULT 0,
    city INT NOT NULL,
    property_options INT NOT NULL,
    bedrooms INT NOT NULL,
    bathrooms INT NOT NULL,
    building_type INT NOT NULL,
    transaction_type INT NOT NULL,
    basement_type INT NOT NULL,
    parking INT NOT NULL,
    housing_style INT NOT NULL,
    flooring INT NOT NULL
);

ALTER TABLE listings OWNER TO group18_admin;

